ode','Dad\'s Pages','2008-07-01 16:52:10','2008-07-01 16:52:10',667,NULL,NULL,1538,NULL),(1539,'Section','wiki page','2008-07-01 16:52:11','2008-07-01 16:53:28',1538,'This is a set of pages authored by Me.\n\nBack to top: [[Hosting]]',NULL,1539,NULL),(1540,'InfoNode','TestOntoRave','2008-07-01 19:37:00','2008-07-03 18:51:10',NULL,NULL,NULL,1540,''),(1541,'Section','wiki page','2008-07-01 19:38:52','2009-08-01 18:54:29',1540,'!>fred.jpg!\r\n\r\nh2. Welcome to OntoRave!\r\n\r\nHello and welcome to OntoRave!  \r\n\r\nOn first inspection, OntoRave looks like a WiKi. In fact, it is meant to offer features that are familiar to WiKi users, but there\'s more...\r\n\r\nOntoRave brings together a number of interesting things that make the WiKi style much more useful.  Among the things that OntoRave does that you won\'t find [yet] in other WiKi-like information capture environments are these:\r\n* Tagging \r\n* Attributes\r\n* Hierarchies of topics\r\n\r\nThis is a [[Sample topic]] - at one time it was a red-link ... following a red link will create a topic with that title.\r\n\r\nTo add pages of your own, please see the [[OntoRave Reference]] and then start adding your own topics under [[User areas]] - and don\'t worry if your pages end up somewhere else; things are easily re-arranged later if needed. \r\n\r\nYou are now in a given Domain called \"TestOntoRave\" ... OntoRave is a multi-tenant application, able to host any number of domains in a single server.  As a member of this domain, you can see and edit its pages, but others belonging to different domains can not.  \r\n\r\n\r\nh2. More information\r\n\r\nSee these topics for more:\r\n* See the markup of this page as an example by clicking the Edit button\r\n* Browse the \"Textile Markup Reference\":http://hobix.com/textile/ \r\n\r\nSee also:\r\n[[@onto_help]]\r\n\r\n... and here is a tabular list of those same items with their attributes.\r\n\r\n||@onto_help||\r\n',NULL,1541,NULL),(1542,'InfoNode','OntoRave Reference','2008-07-02 07:58:27','2008-07-02 07:58:27',1540,NULL,NULL,1542,NULL),(1543,'Section','wiki page','2008-07-02 08:06:50','2008-10-25 02:37:36',1542,'||.||\n\nh2. Resources\n\nPlease see these resources for more information\n* Browse the \"Textile Markup Reference\":http://hobix.com/textile/ \n\nh2. Special content macros\n\n* *&#91;&#91;Topic Title]]* inserts a link to the named topic.  If the topic does not exist, the link will be in red. Following the link creates the topic page and places you in the mode of editing its contents.\n* *&#91;&#91;>Topic Title]]* find topic directly under the current topic; create under current topic if it needs to be created. \n* *&#91;&#91;>>Topic Title]]* find topic in the subtree of topics under the current topic; create under current topic if it needs to be created. \n* *&#91;&#91;1234]]* link to topic by ID - see upper-right corner of any view for a topic\'s ID number. As a consequence of allowing the same topic title to be used for multiple topics at different levels in the hierarchy, a direct ID reference is sometimes required to unambiguously refer to a topic. This also safely links the topic by a value that is not change-able, as opposed to link-by-name, which can be broken when topics are renamed. \n\n* *&#91;&#91;@tag_name(s)]]* inserts a list of topics that are marked by the given tag name(s). Separate multiple tags by spaces. \n* *&#124;&#124;@tag_name(s)||* inserts an attribute table of topics that are marked by the given tag name(s). Separate multiple tags by spaces. \n\n* *&#91;&#91;>]]* inserts the list of subtopics found immediately under the current topic. \n* *&#124;&#124;>||* inserts an attribute table of subtopics found immediately under the current topic.\n\n* *&#124;&#124;.||* inserts an attribute table for just the current topic. \n\n* *&#123;&#123;Topic Title}}* finds the topic by name and inserts the full text of the topic in-line at this point.\n* *&#123;&#123;1234}}* finds the topic by ID and inserts the full text of the topic number in-line at this point.\n\n<hr/>\n\nh5. Table options\n\nTake a look at this example to see how to specify table options\n\n||@is_person|| { :select => [\'Name\', \'E-Mail\'], :order_by => \'E-Mail\' }\n\n<hr/>\n\n\nh2. Philosophy\n\nh3. Why tagging?  \n\nTags are useful in navigation and in applying semantic rules. First, \'tag\' is short way of saying \'classification label\' and as such tags are used... well... to classify things.  If I tag a topic with a tag called \'project\' I can now ask for the set of topics that bear the tag \'project\' and my project topic will be among the matching items. This is different, and better, from having to manually maintain a page that lists projects, and hope that everyone remembers to update the list.  Also, the tag \'project\' can be used to collect topics, and to apply rules & constraints to such topics as we will later see. \n\nFurther, we can assign multiple tags.  For example, I can assign the tags \'active\' or \'finished\' as well.  Now I can find active projects or finished projects by asking for topics with tags in these combinations.  What I am effectively doing is asking for topics in the intersection of the sets of topics marked by each tag.  We can do several interesting things in OntoRave by leveraging tags as classifications.  See the macros above, for example. \n\nh3. Why attributes?  \n\nAttributes are useful for keeping discrete facts about a topic, without needing to read and parse the body of a topic to find them.  So, if we would like to provide a *milestone status* indicator on our project description, we can do so using an attribute, and use markup macros to automatically create tabular summaries of attributes of topics with certain tags.  E.g., we can ask for a table of active projects with their current milestone status.  \n\nIf it is helpful, think of your topics as information objects, and attributes as descriptive properties attached to those objects that are useful to know from the *outside* of the object, that is, without diving into the text inside. \n\nh3. Why topic hierarchies?\n\nWhen organizing information, we use structure to help us.  Recognize that topics don\'t naturally form a flat space; there are topics, and within them there are subtopics that address specialized areas.  A browse-able hierarchy of topics allows us to group related items, and provides a helpful outline to follow that is separate from the content.  \n\nCombining this structure with the open-ended support for creating hyperlink references between topics, one creates a \"threaded hierarchy\" which is arguably more familiar and meaningful than a flat reference graph with no starting points.  \n\nThat said, use of hierarchy is optional.  OntoRave allows you to just link topics in the usual WiKi way.  Also, it is important to consider what creating a threaded hierarchy means to the information reader/browser.  Many times, it makes more sense to place subtopics as sections within a topic, separated by section headers. \n\nIn a typical WiKi, there is no concept of \"belongs to\" among topics. Instead, all topic pages are of equal importance, relevance, and scope.    \n\nSo, how does this add up to advice about when to create a topic, subtopic, or topic section?  I suggest the following guidelines. \n* Don\'t create hierarchies arbitrarily; they should form a cohesive body of knowlege. \n* Think of topic hierarchies in the context of composing chapters of a book.  Within a book, text may refer to another book, or to chapters of other books, but the topics *within* a given book are strongly composed together, and it should make sense for them to be strongly associated in this way. \n* In an information flow, topics that feel like \"see also\" topics should stand on their own, outside of the current hierarchy. \n* How strongly is a subtopic connected to its outer topic?  So much so, that if you delete the outer topic, the subtopic goes with it, and its subtopics, all the way down.  That\'s how you should think of the relationship between topics and subtopics. If the outer topic becomes irrelevant, the subtopic becomes irrelevant as well. \n\nSubtopic attributes can be rolled up and presented in the context of an outer topic. See above. \n\nLastly, there is the intent to soon provide a feature to combine the topics within a topic hierarchy in such a way that a single \"book\" view of the whole can be presented. \n\n\nh2. Advanced features\n\nh5. Templates\n\nOne of the more exciting features of OntoRave is its ability to template entire hierarchies of information nodes.  When a template is established, it should be tagged with a tag that uses the naming convention \'as_XYZ\' where XYZ is the name of the template as you want it to be referred to by nodes that follow it.  \n\nTo follow a template, an information node needs to have a tag that uses the naming convention \'is_XYZ\' ... which is to say this information item is an XYZ, apply the structure of the information item that demonstrates what it means to act as an XYZ. \n\nContent, attributes and subtopics are all considered part of a template, and are copied into any node that follows it. Also, if to add items to a template, the next time you open a node that follows it, the node will be caught up to be consistent with the items added. Note that items are never removed from followers if they are removed from a template, becuase the items within the followers may have siginifcant content that would be otherwise be lost. \n\nNote that template entries do not need to occur in any special place within the information node hierarchy.  Nevertheless, by convention it is a good idea to keep them together.  \n\nYou can see this demonstrated in the example having to do with the [[person]] template entry.  If you inspect this node, you will see that in both has both content, and a set of attributes. Both will be promoted to any information node that follows it.  \n\nh5. Automatic tagging\n\nWhen you create a new person subtopic under [[User areas]] it automatically acquires the \'is_person\' tag, and in turn a set of attributes from the person template.  How does the \'is_person\' tag get applied to the subtopic?  This tag was added to the [[User areas]] topic with a scope setting to apply it to all subtopics on-going.  \n',NULL,1543,NULL),(1544,'InfoNode','User areas','2008-07-02 08:07:25','2008-07-02 08:07:26',1540,NULL,NULL,1544,NULL),(1545,'Section','wiki page','2008-07-02 08:07:30','2009-08-29 15:07:48',1544,'The topics under this one are meant to be the starting points for topics that individual users would catalogue. \r\n\r\n\r\nLook to the left margin for the current subtopics of this topic. \r\n\r\nYou can add another... \r\n\r\nNext level subtopics can be enumerated in a list like this (see edit view):\r\n[[>]]\r\n\r\nThat\'s easy.\r\n\r\nHow about a table of their attributes:\r\n\r\n||>||\r\n\r\nAlso easy.\r\n\r\n[[>Fred]] is a ref to Fred\'s page and only if it is directly below this topic.\r\n\r\n\r\nh2. Topic page inclusions by ID and by name\r\n\r\n<table>\r\n<tr>\r\n<td valign=\"top\">{{1558}}</td>\r\n<td valign=\"top\">{{Diana}}</td>\r\n</tr>\r\n</table>\r\n',NULL,1545,NULL),(1548,'InfoNode','Beta Feedback','2008-07-02 08:49:30','2008-07-02 08:49:30',1540,NULL,NULL,1548,NULL),(1549,'Section','wiki page','2008-07-02 08:49:30','2008-07-16 13:37:21',1548,'Please add your comments here:\n\n* Need a better explanation of attributes.\n\n* Need to be able to assign attributes to multiple selected topics at once\n* Need to be able to assign tags to multiple selected topics at once\n* Add the notion of a \"select list\" to support the above\n\n* Need a tabular edit view (like a spreadsheet) for editing attributes in cells, having the selected objects all in rows. \n\n* The need to go to the Edit view to add/modify attributes seems too \"modal\" ... it should be possible right in the topic view page (as it is for tags)',NULL,1549,NULL),(