13:24:32',1682,'Cisco Firewall Services Module (FWSM)â€”a high-speed, integrated firewall module for Cisco Catalyst 6500 switches and Cisco 7600 Series routersâ€”provides the fastest firewall data rates in the industry: 5-Gbps throughput, 100,000 CPS, and 1M concurrent connections. \r\n\r\nThe Cisco FWSM includes a number of advanced features that help reduce costs and operational complexity while enabling organizations to manage multiple firewalls from the same management platform. Features such as resource manager helps organizations limit the resources allocated to any security context at any time thus ensuring that one security context does not interfere with another. The transparent firewall feature configures the FWSM to act as a Layer 2 bridging firewall resulting in minimal changes to network topology.\r\n\r\n',NULL,1683,NULL),(1684,'Attribute','Acronym','2008-07-07 13:19:19','2008-07-07 13:19:19',1682,NULL,'FWSM',1684,NULL),(1685,'Attribute','Category','2008-07-07 13:22:09','2008-07-07 13:22:09',1682,NULL,'Infrastructure',1685,NULL),(1686,'Attribute','Vendor','2008-07-07 13:22:48','2008-07-07 13:22:48',1682,NULL,'Cisco',1686,NULL),(1687,'Attribute','License','2008-07-07 13:22:48','2008-07-07 13:22:48',1682,NULL,'',1687,NULL),(1688,'Attribute','Date Implemented','2008-07-07 13:23:03','2008-07-07 13:23:03',1682,NULL,'',1688,NULL),(1689,'InfoNode','Intelligent Services Gateway','2008-07-07 13:27:18','2008-07-07 13:27:18',1678,NULL,NULL,1689,NULL),(1690,'Section','wiki page','2008-07-07 13:27:47','2008-07-07 13:28:13',1689,'The Cisco Intelligent Services Gateway offers Service Providers an opportunity to take direct control of resources and characteristics in their broadband network to deliver next generation services by:\r\n\r\n* Controlling, securing & differentiating services via intelligent policies embedded directly in the network or received via open and standards-based control interfaces to the BSS \r\n* Customizing Service Convergence with zero-touch provisioning across customized networks \r\n* Distributing IP Session control into the network while simultaneously maintaining consistent PPP session control ',NULL,1690,NULL),(1691,'Attribute','Category','2008-07-07 13:28:55','2008-07-07 13:28:55',1689,NULL,'Infrastructure',1691,NULL),(1692,'Attribute','Vendor','2008-07-07 13:28:55','2008-07-07 13:28:55',1689,NULL,'Cisco',1692,NULL),(1693,'Attribute','Date Implemented','2008-07-07 13:28:55','2008-07-07 13:28:55',1689,NULL,'12/03/2006',1693,NULL),(1694,'Section','wiki page','2008-07-07 13:30:51','2008-07-07 13:44:08',1680,'A tool suite that helps the business gain visibility into business-critical information, strengthen financial discipline and governance best practices, and realize efficiencies by automating and standardizing key business processes. These applications integrate with other solutions across departmental lines to help you implement departmental and industry best practices for all of your business processes.',NULL,1694,NULL),(1695,'Attribute','Category','2008-07-07 13:32:33','2008-07-07 13:32:33',1680,NULL,'Business',1695,NULL),(1696,'Attribute','Vendor','2008-07-07 13:32:33','2008-07-07 13:32:33',1680,NULL,'Oracle',1696,NULL),(1697,'Attribute','Date Implemented','2008-07-07 13:32:33','2008-07-07 13:32:33',1680,NULL,'1/31/2001',1697,NULL),(1698,'Section','wiki page','2008-07-07 13:33:09','2008-07-07 13:42:51',1681,'A tool suite that unlocks the full value of your organization\'s workforce. PeopleSoft HCM enables you to put the right people in the right jobs, develop and reward top performers, retain key talent for the long term, and increase efficiency and operating performance throughout your organization.',NULL,1698,NULL),(1699,'Attribute','Vendor','2008-07-07 13:34:48','2008-07-07 13:34:48',1681,NULL,'Oracle',1699,NULL),(1700,'Attribute','Acronym','2008-07-07 13:34:48','2008-07-07 13:34:48',1681,NULL,'HCM',1700,NULL),(1701,'Attribute','License','2008-07-07 13:38:21','2008-07-07 13:38:21',1681,NULL,'